  const [employees, setEmployees] = useState([]);

  useEffect(() => {
    if (token.length === 0) {
      console.log(token, "1111111111111111");
      Api.getToken(setToken);
      console.log(token, "1111111111111111");
    }
  });

  return (
    <div className="App">
      <Employee employees={employees} />
      <Team />
      <Alliance />
    </div>
  );
}

export default App;
